import React from 'react'

var Siv = ()=>{
    var title = 'Chodavaram'
return( <>
        <h1>{title}</h1>
        <p>Chodavaram is a small village in Ramachandrapuram Mandal, East Godavari District, Andhra Pradesh, India.</p>
        <Vis/> <Sai/>
    </>
   )
}
export default Siv
var Vis = ()=>{
    var title = 'Ramachandrapuram'
return  (<>
        <h1>{title}</h1>
        <p>Ramachandrapuram is a town in East Godavari district of the Indian state of Andhra Pradesh. The town is a Municipality which serves as the headquarters of Ramachandrapuram mandal and Ramachandrapuram revenue division.</p>
    </>
)
}

var Sai = ()=> {
    var title = 'East godavari'
return (<>
        <h1>{title}</h1>
        <p>East Godavari is a district in the Coastal Andhra region of Andhra Pradesh, India. Its district headquarters is at Kakinada. As of Census 2011, it became the most populous district of the state with a population of 5,151,549.</p>
    </>
    )
}
